// react
import React, { Component } from 'react';

// third-party
import { Route } from 'react-router-dom';

export default class Routes extends Component {
    render() {
        const Routes = ({ component: Component, layout: Layout, ...rest }) => (
            <Route
                {...rest}
                render={props => (
                    <Layout>
                        <Component {...props} />
                    </Layout>
                )}
            />
        );

        return (
            <React.Fragment>
                {Routes}
            </React.Fragment>
        );
    }
}
